import React from "react";

import TextField from "@material-ui/core/TextField";

import Grid from "@material-ui/core/Grid";

import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  paper: {
      _marginTop: theme.spacing(8),
      get marginTop() {
          return this._marginTop;
      },
      set marginTop(value) {
          this._marginTop = value;
      },
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: "100%", // Fix IE 11 issue.
    // marginTop: theme.spacing(3),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
    fontSize: 16,
  },
  labelRoot: {
    fontSize: 12,
  },
}));
const Covid = () => {
    const classes = useStyles();
  return (
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6} lg={6}>
          <TextField
            autoComplete="fname"
            name="firstName"
            variant="outlined"
            required
            fullWidth
            id="firstName"
            label="Name"
            InputLabelProps={{
              classes: {
                root: classes.labelRoot,
              },
            }}
          />
        </Grid>


        <Grid item xs={12}>
          <TextField
            variant="outlined"
            required
            fullWidth
            id="email"
            label="Email Address"
            name="email"
            autoComplete="email"
            InputLabelProps={{
              classes: {
                root: classes.labelRoot,
              },
            }}
          />
        </Grid>

        <Grid item xs={12} sm={6} lg={6}>
          <TextField
            autoComplete="fname"
            name="PhoneNumber"
            variant="outlined"
            required
            fullWidth
            id="PhoneNumber"
            label="PhoneNumber"
            InputLabelProps={{
              classes: {
                root: classes.labelRoot,
              },
            }}
          />
        </Grid>

        <Grid item xs={12}>
          <TextField
            variant="outlined"
            required
            fullWidth
            name="password"
            label="Password"
            type="password"
            id="password"
            autoComplete="current-password"
            InputLabelProps={{
              classes: {
                root: classes.labelRoot,
              },
            }}
          />
        </Grid>
      </Grid>
  );
};

export default Covid;
